import Dog from "./Dog";
import React, { useState } from "react";
import "../stylesheets/layouts/DogList.scss";

const DogList = (props) => {
  const handleClickPrev = () => {
    setIndex(index - 1);
  };
  const handleClickSig = () => {
    setIndex(index + 1);
  };
  const [index, setIndex] = useState(0);
  return (
    <>
      <li key={props.dogs.id} className="dogList">
        <Dog dogs={props.dogs[index]} />
      </li>
      {index > 0 ? (
        <button className="button__prev" onClick={handleClickPrev}>
          Anterior
        </button>
      ) : (
        <button className="button__prev--empty">Anterior</button>
      )}
      {index < props.dogs.length ? (
        <button className="button__sig" onClick={handleClickSig}>
          Siguiente
        </button>
      ) : (
        <button className="button__sig--empty">
          <img src="./images/arrowleft" />
        </button>
      )}
    </>
  );
};

export default DogList;
